public void testSelfCombine() {
    CountMetricsImpl impl = new CountMetricsImpl();
    impl.combine(5);
    impl.combine(6);
    impl.combine(7);

    CountMetricsImpl impl2 = new CountMetricsImpl();
    impl2.combine(5);
    impl2.combine(6);
    impl2.combine(7);

    impl.combine(impl2);

    impl.calculate();

    Assert.assertEquals(36, impl.getValue());
}

